import React from 'react';

function App() {
  return (
    <div style={styles.container}>
      <header style={styles.header}>
        <h1>Welcome to My React Page</h1>
        <p>This is a simple React page example.</p>
      </header>
      <main style={styles.main}>
        <p>Feel free to explore and modify this basic template.</p>
        <button style={styles.button} onClick={() => alert('Hello, React!')}>
          Click Me!
        </button>
      </main>
      <footer style={styles.footer}>
        <p>Created with React</p>
      </footer>
    </div>
  );
}

// Inline CSS styles
const styles = {
  container: {
    fontFamily: 'Arial, sans-serif',
    textAlign: 'center',
    margin: 0,
    padding: 0,
    color: '#333',
  },
  header: {
    backgroundColor: '#282c34',
    color: 'white',
    padding: '20px',
  },
  main: {
    margin: '20px',
  },
  button: {
    backgroundColor: '#61dafb',
    color: 'white',
    border: 'none',
    padding: '10px 20px',
    borderRadius: '5px',
    cursor: 'pointer',
    fontSize: '16px',
  },
  footer: {
    backgroundColor: '#f1f1f1',
    padding: '10px',
    marginTop: '20px',
  },
};

export default App;
